import './App.css';
import  { useState } from 'react';



function App() {
  const [count, setCount] = useState(0);

  const add_mes = () => {
    if(count === "Hello World"){
      setCount("Hello World");
    }


  }; 


  return (
    <div>
      <div>
        {count}
      </div>
      <input type="text"/>
      <button onClick={add_mes}>送信</button>
    </div>
  );
}

export default App;
